import * as React from "react";
// import {
//   Chart,
//   ScatterSeries,
//   Legend,
//   ArgumentAxis,
//   ValueAxis,
// } from "@devexpress/dx-react-chart-material-ui";

import {
  Chart,
  Series,
  CommonSeriesSettings,
  Point,
  Legend,
  ValueAxis,
  ArgumentAxis,
  Grid,
  MinorGrid,
  CommonPaneSettings,
  Border,
} from "devextreme-react/chart";
// import { Animation } from "@devexpress/dx-react-chart";
// import { Border, CommonPaneSettings } from "devextreme-react/chart";

const TeacherGraph = (props) => {
  return (
    <Chart id="chart" dataSource={props.data} className="w-100">
      <CommonSeriesSettings type="scatter" />
      <Series
        name="Serie predefinita1"
        valueField="val1"
        argumentField="arg1"
      />
      <Series
        name="Serie predefinita2"
        valueField="val2"
        argumentField="arg2"
      />
      <ArgumentAxis tickInterval={5}>
        <Grid visible={true} />
        <MinorGrid visible={true} />
      </ArgumentAxis>
      <ValueAxis tickInterval={50} />
      <CommonPaneSettings>
        <Border visible={true} />
      </CommonPaneSettings>
      <Legend position="bottom" />
      {/* <Animation /> */}
    </Chart>
  );
};

export default TeacherGraph;
